import React from "react";

const ToDoLists = (props) => {
  const deleteItems = () => {
    console.log("Item deleted");
  };

  return (
    <>
      <div className="todo_style">
        <i class="fa fa-times" aria-hidden="true" onClick={deleteItems}></i>
        <li>{props.text}</li>
      </div>
    </>
  );
};

export default ToDoLists;
